measurements.description:
One large stunning flower and one bud on one 10-cm inflorescence;
	dorsal sepal cream overlaid charteuse, well-marked mahogany veins, mahogany areas basally;
	synsepal cream overlaid chartreuse, mahogany veins;
	petals hirsute, pleasingly twisted, chartreuse, striped and blotched  mahogany;
	pouch light green, heavily spotted mahobany; 
	staminode bright green overlaid mahogany; 
	substance firm; texture glossy.
